translation.SignInDaily:
1. Sign in daily to collect rewards.;
2. The higher the consecutive sign-in days, the more generous the rewards;
Day 1, you can collect 1 bag of food;
Day 2, you can collect 1 bag of food;
Day 3, you can collect 2 bags of food;
Day 4, you can collect 2 bags of food;
Day 5, you can collect 3 bags of food;
For a consecutive sign-in streak of ≥5 days, you can collect 3 bags of food for each sign-in.
3. If the sign-in streak is interrupted, the sign-in rewards will be reset, and counting will start from the first day.
